import Clients from "./components/Clients";
import Projects from "./components/Projects";
import AddClientModal from "./components/AddClientModal";

const Home = () => {
  return (
    <>
      <AddClientModal />
      <Projects />
      <hr />
      <Clients />
    </>
  );
};

export default Home;
